import React, { useEffect, useState } from "react";
import API from "../../utils/API"

function Setlist() {

    const [data, setData] = useState({ setlists: [] });
    const getSetlists = () => {
        this.setState({ ...this.state });
        API.getSetlists()
            .then(res => {
                this.setState({ setlists: res.data })
            })
            .catch(err => {
                console.log(err);
                this.setState({ ...this.state })
            })
    }



    return (
        <>
            {
                this.state.setlists.map(setlist => {
                    <li className="list-group-item">
                        <strong>
                            Name: {setlist.name} Gig Type: {setlist.gigtype}
                        </strong>
                    </li>
                })
            }
        </>
    )
}
export default Setlist;
